import './singlePage.scss';

function SinglePage() {
  return (  
    <div className='singlePage' >
      <div className="details">
        <div className="wrapper">
          <Slider/>
        </div>
      </div>
      <div className="features">
        <div className="wrapper"></div>
      </div>
    </div>
  )
}

export default SinglePage
